import place from './placeholder.png';
import react from 'React';
import './App.css';

function App() {
  return (
    <div>
      <ul>
        <li>
          <img src="placeholder.png" class="image" />
          <div class="name">
            SERIES
          </div>
          <div class="">
            <p>Popular Series</p>
          </div>
        </li>
        <li>
          <img src="placeholder.png" class="image"/>
          <div class="name2">
            MOVIES
          </div>
          <div class="">
            <p>Popular Movies</p>
          </div>
        </li>
      </ul>
    </div>
  );
}

export default App;
